import "../App.css"
import Button from '@mui/material/Button';
import { BrowserRouter, Route, Link } from "react-router-dom";

export default function Project(props) {
    console.log('porjects', props)

    return(

            <div class="Product"> 
                <h4>{props.name}</h4>
                <img src={props.image}/>
                {props.desc}
                <a target="_blank" href={process.env.PUBLIC_URL + props.link}>More</a>

<button class="button-16" role="button">Button 16</button>

                <button className="button-6" target="_blank" link={process.env.PUBLIC_URL + props.link} >Button 6</button>

            </div> 


    )
}
